import React from "react";
import Navbar from "../navmenu/Navbar";
import Contact from "../Contact";
import { withStyles } from "@material-ui/core/styles";
import BlogPostTemplate from "./BlogPostTemplate";
import animalImg from "../../img/animal.jpg";
import { Typography, Box } from "@material-ui/core";

const styles = (theme) => ({
  contentArea: {
    width: "70%",
    margin: "0 auto 5rem auto",
  },
  paragraphTitle: { lineHeight: "3rem", margin: "0 0 1rem 0" },
  paragraphContent: {
    lineHeight: "2rem",
    margin: "0 1rem 1rem 1rem",
    textAlign: "justify",
  },
});

const BlogPost1 = (props) => {
  const { classes } = props;

  return (
    <>
      <Navbar />
      <Box className={classes.contentArea}>
        <BlogPostTemplate
          title='"animals"'
          subtitle='the picture I found when I searched "animal" on google'
          date="August 15, 2020"
          image={animalImg}
        />
        <Typography variant="h5" className={classes.paragraphTitle}>
          Why I Googled "animal"
        </Typography>
        <Typography variant="body1" className={classes.paragraphContent}>
          The most momentous occasion of my life has just occurred. Before I
          tell you the story of googling the word "animal", let me give you some
          backstory.
        </Typography>
        <Typography variant="body1" className={classes.paragraphContent}>
          I decided I wanted to make a website to try out web development more.
          I debated long and hard about what type of site to build, and I
          finally decided to make a personal portfolio and blog. After I started
          development, I realized I wanted to have pictures for the blog and
          other parts of the site. Not planning on writing the blogs right then
          and there, I obviously needed to get mock/filler pictures. Do I get
          random pictures? Do I get pictures of myself? Do I google images? What
          term would I google? It's pretty hard to find "random" pictures when
          you have to think about how to acquire a random picture. It felt weird
          using selfies because then I'd have to stare at my face for hours
          while making the site. Torn about what to do, I started scrolling
          through my camera roll and I came across my cat album.
        </Typography>

        <body>
          {" "}
          Ever since quarantine, I've really liked looking at cats on the
          internet because they're derpy and always behave questionably. I then
          made the genius connection that cats are animals. Naturally, my mind
          went to searching for animal pictures to use as the filler pictures.
          This was the most amazing idea of my lifetime. No one has ever used
          animal pictures before. Ever. So, I googled the word "animal". After
          just two scrolling motions of my pointer finger, I found the jackpot -
          the perfect photo. I felt an indescribable wave as I looked at the
          photo above.
        </body>
      </Box>
      <Contact />
    </>
  );
};

export default withStyles(styles)(BlogPost1);
